const SET_CATEGORY = 'category/setCategory';

const homeCategoryReducer = (state = {}, action) => {
	let newState;
	switch (action.type) {
		case SET_CATEGORY:
			newState = Object.assign({}, state);
		default:
			return state;
	}
};
